/**
 * Return the current version of ilib.
 *
 * @static
 * @return {string} a version string for this instance of ilib
 */
ilib.getVersion = function () {
    if (ilib._dyncode) {
        try {
            var pkg;
            pkg = require("../package.json");
            return pkg.version;
        } catch (e) {
            // ignore
        }
    }
    return ilib._ver() || "14.0";
};

